 max, range);\n    };\n}\n\nclearTimeout(window._bt_autoscale_timeout);\n\nwindow._bt_autoscale_timeout = setTimeout(function () {\n    /**\n     * @variable cb_obj `fig_ohlc.x_range`.\n     * @variable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"24462","type":"CustomJS"},{"attributes":{"data":{"Close":{"__ndarray__":"exSuR+HqUkAK16NwPRpTQMP1KFyPYlJASOF6FK5XUkBSuB6F66FSQBSuR+F6hFJAmpmZmZnJUkBcj8L1KLxSQGZmZmZm5lJAuB6F61EYU0AfhetRuD5TQFK4HoXrIVNApHA9CtfzUkCF61G4HrVSQBSuR+F69FFAzczMzMz8UUAAAAAAAOBRQM3MzMzMvFFAMzMzMzNzUUBxPQrXo1BRQJqZmZmZiVFAj8L1KFx/UUAAAAAAAOBRQDMzMzMzM1JAzczMzMxcUkAzMzMzM7NSQFyPwvUorFJApHA9CtezUkAAAAAAAJBSQAAAAAAAkFJAexSuR+G6UkCF61G4HtVSQMP1KFyP4lJAj8L1KFwPU0AUrkfheuRSQHsUrkfhulJApHA9CtcDU0D2KFyPwsVSQNejcD0KZ1JAPQrXo3CtUkBSuB6F60FSQD0K16NwjVJArkfhehSuUkDXo3A9CudSQD0K16Nw/VJAUrgehevxUkAAAAAAAPBSQEjhehSu51JAZmZmZmb2UkCF61G4HtVSQPYoXI/CtVJA9ihcj8LFUkApXI/C9bhSQLgehetRWFJApHA9CtdTUkCPwvUoXB9SQAAAAAAAQFJAAAAAAAAgUkDD9ShcjxJSQHE9Ctej4FFAPQrXo3DtUUAK16NwPQpSQArXo3A9+lFAFK5H4XrkUUAfhetRuP5RQClcj8L1+FFAUrgehetBUkBI4XoUrldSQKRwPQrXA1JAPQrXo3BNUkDNzMzMzGxSQK5H4XoUPlJA7FG4HoVLUkBxPQrXo3BSQClcj8L1aFJAFK5H4XpkUkA9CtejcC1SQFyPwvUoXFJAFK5H4XrUUkBmZmZmZkZTQGZmZmZmNlNAFK5H4XoEU0AzMzMzM3NTQBSuR+F6NFNAcT0K16MwU0AUrkfheiRTQBSuR+F6FFNAj8L1KFxfU0B7FK5H4UpTQArXo3A9KlNAuB6F61H4UkAK16NwPepSQBSuR+F69FJAZmZmZmbGUkAfhetRuO5SQKRwPQrXE1NAhetRuB4lU0AAAAAAAEB
